INSERT INTO public.series OVERRIDING SYSTEM VALUE VALUES (1, 'AG.LND.AGRI.ZS', 'Agricultural land (% of land area)', 'Agricultural land refers to the share of land area that is arable, under permanent crops, and under permanent pastures. Arable land includes land defined by the FAO as land under temporary crops (double-cropped areas are counted once), temporary meadows for mowing or for pasture, land under market or kitchen gardens, and land temporarily fallow. Land abandoned as a result of shifting cultivation is excluded. Land under permanent crops is land cultivated with crops that occupy the land for long periods and need not be replanted after each harvest, such as cocoa, coffee, and rubber. This category includes land under flowering shrubs, fruit trees, nut trees, and vines, but excludes land under trees grown for wood or timber. Permanent pasture is land used for five or more years for forage, including natural and cultivated crops.', 'World Development Indicators', 'Food and Agriculture Organization, electronic files and web site.');
INSERT INTO public.series OVERRIDING SYSTEM VALUE VALUES (2, 'AG.LND.ARBL.ZS', 'Arable land (% of land area)', 'Arable land includes land defined by the FAO as land under temporary crops (double-cropped areas are counted once), temporary meadows for mowing or for pasture, land under market or kitchen gardens, and land temporarily fallow. Land abandoned as a result of shifting cultivation is excluded.', 'World Development Indicators', 'Food and Agriculture Organization, electronic files and web site.');
INSERT INTO public.series OVERRIDING SYSTEM VALUE VALUES (3, 'AG.LND.FRST.ZS', 'Forest area (% of land area)', 'Forest area is land under natural or planted stands of trees of at least 5 meters in situ, whether productive or not, and excludes tree stands in agricultural production systems (for example, in fruit plantations and agroforestry systems) and trees in urban parks and gardens.', 'World Development Indicators', 'Food and Agriculture Organization, electronic files and web site.');
INSERT INTO public.series OVERRIDING SYSTEM VALUE VALUES (4, 'AG.LND.TOTL.K2', 'Land area (sq. km)', 'Land area is a country''s total area, excluding area under inland water bodies, national claims to continental shelf, and exclusive economic zones. In most cases the definition of inland water bodies includes major rivers and lakes.', 'World Development Indicators', 'Food and Agriculture Organization, electronic files and web site.');
INSERT INTO public.series OVERRIDING SYSTEM VALUE VALUES (5, 'AG.LND.TOTL.RU.K2', 'Rural land area (sq. km)', 'Rural land area in square kilometers, derived from urban extent grids which distinguish urban and rural areas based on a combination of population counts (persons), settlement points, and the presence of Nighttime Lights. Areas are defined as urban where contiguous lighted cells from the Nighttime Lights or approximated urban extents based on buffered settlement points for which the total population is greater than 5,000 persons.', 'World Development Indicators', 'Center for International Earth Science Information Network (CIESIN)/Columbia University. 2013. Urban-Rural Population and Land Area Estimates Version 2. Palisades, NY: NASA Socioeconomic Data and Applications Center (SEDAC). http://sedac.ciesin.columbia.edu/data/set/lecz-urban-rural-population-land-area-estimates-v2.');
INSERT INTO public.series OVERRIDING SYSTEM VALUE VALUES (6, 'AG.LND.TOTL.UR.K2', 'Urban land area (sq. km)', 'Urban land area in square kilometers, based on a combination of population counts (persons), settlement points, and the presence of Nighttime Lights. Areas are defined as urban where contiguous lighted cells from the Nighttime Lights or approximated urban extents based on buffered settlement points for which the total population is greater than 5,000 persons.', 'World Development Indicators', 'Center for International Earth Science Information Network (CIESIN)/Columbia University. 2013. Urban-Rural Population and Land Area Estimates Version 2. Palisades, NY: NASA Socioeconomic Data and Applications Center (SEDAC). http://sedac.ciesin.columbia.edu/data/set/lecz-urban-rural-population-land-area-estimates-v2.');
INSERT INTO public.series OVERRIDING SYSTEM VALUE VALUES (7, 'NY.GDP.MKTP.CD', 'GDP (current US$)', 'GDP at purchaser''s prices is the sum of gross value added by all resident producers in the economy plus any product taxes and minus any subsidies not included in the value of the products. It is calculated without making deductions for depreciation of fabricated assets or for depletion and degradation of natural resources. Data are in current U.S. dollars. Dollar figures for GDP are converted from domestic currencies using single year official exchange rates. For a few countries where the official exchange rate does not reflect the rate effectively applied to actual foreign exchange transactions, an alternative conversion factor is used.', 'World Development Indicators', 'World Bank national accounts data, and OECD National Accounts data files.');
INSERT INTO public.series OVERRIDING SYSTEM VALUE VALUES (8, 'NY.GDP.PCAP.CD', 'GDP per capita (current US$)', 'GDP per capita is gross domestic product divided by midyear population. GDP is the sum of gross value added by all resident producers in the economy plus any product taxes and minus any subsidies not included in the value of the products. It is calculated without making deductions for depreciation of fabricated assets or for depletion and degradation of natural resources. Data are in current U.S. dollars.', 'World Development Indicators', 'World Bank national accounts data, and OECD National Accounts data files.');
INSERT INTO public.series OVERRIDING SYSTEM VALUE VALUES (9, 'SP.POP.TOTL', 'Population, total', 'Total population is based on the de facto definition of population, which counts all residents regardless of legal status or citizenship. The values shown are midyear estimates.', 'World Development Indicators', '(1) United Nations Population Division. World Population Prospects: 2019 Revision. (2) Census reports and other statistical publications from national statistical offices, (3) Eurostat: Demographic Statistics, (4) United Nations Statistical Division. Population and Vital Statistics Reprot (various years), (5) U.S. Census Bureau: International Database, and (6) Secretariat of the Pacific Community: Statistics and Demography Programme.');
